import React, { useState } from 'react';

const YearRangeSelection = () => {
  const currentYear = new Date().getFullYear();
  const [startYear, setStartYear] = useState(currentYear - 5);
  const [endYear, setEndYear] = useState(currentYear + 5);

  const handleStartYearChange = (event) => {
    setStartYear(parseInt(event.target.value, 10));
  };

  const handleEndYearChange = (event) => {
    setEndYear(parseInt(event.target.value, 10));
  };

  return (
    <div>
      <div>
        <label>Start Year:</label>
        <input
          type="number"
          min={1900}
          max={currentYear}
          value={startYear}
          onChange={handleStartYearChange}
        />
      </div>
      <div>
        <label>End Year:</label>
        <input
          type="number"
          min={startYear}
          max={currentYear + 100}
          value={endYear}
          onChange={handleEndYearChange}
        />
      </div>
      <p>Selected Year Range: {startYear} - {endYear}</p>
    </div>
  );
};

export default YearRangeSelection;
